import axios from "axios";

const SIGNUP = "SIGNUP";

export async function signup(formData) {
  const result = await axios.post(
    "http://localhost:3065/user/signup",
    formData
  );
  const req2 = await result.json();
  const req = JSON.parse(req2);
  return {
    type: SIGNUP,
    payload: req,
  };
}

const initialState = {
  isLoggedIn: false,
  myInfo: null,
  signupInfo: null,
};

export default function reducer(state = initialState, action) {
  switch (action.type) {
    case SIGNUP:
      return {
        ...state,
        signupInfo: action.payload,
      };
    default:
      return state;
  }
}
